import { SendOutlined } from "@mui/icons-material";
import { Box, Fab, Stack, TextField, Typography } from "@mui/material";
import { Container } from "@mui/system";
import React from "react";

const Newsetter = () => {
  return (
    <Box sx={{ py: 4 }}>
      <Container sx={{ textAlign: "center" }}>
        <Typography variant="h4">News Letter</Typography>
        <Typography>
          “Success hinges less on getting everything right than on how you
          handle getting things wrong.” Michelle Russel
        </Typography>

        <Stack
          direction="row"
          justifyContent="center"
          alignItems="center"
          sx={{ mt: 4 }}
        >
          <input className="new-letter-input" />
          <Fab size="medium" sx={{ ml: "-48px" }}>
            <SendOutlined />
          </Fab>
        </Stack>
      </Container>
    </Box>
  );
};

export default Newsetter;
